import React from 'react'
const BrowserHistory = require('react-router-dom/lib/BrowserHistory').default;

const GoBackButton = () => {
  return (
    <div class="go-back-button" onClick={BrowserHistory.history.goback}>
    </div>
  )
}

export default GoBackButton
